import Link from 'next/link'
import styled from 'styled-components'

const linkStyle = {
  marginRight: 15
}

const A = styled.a`
  background: transparent;
  border-radius: 3px;
  border: 2px solid palevioletred;
  color: palevioletred;
  margin: 0 1em;
  padding: 0.25em 1em;
`

export default function Header() {
  return (
    <div>
      <Link href="/">
        <a style={linkStyle}>Latest posts</a>
      </Link>
      <Link href="/posts/new">
        <a style={linkStyle}>New post</a>
      </Link>
    </div>
  )
}
